outcomeMeasures.description:
Booster responses to the PT, FHA and PRN antigens were defined as:

* For initially seronegative subjects (antibody concentrations: \< 2.046 IU/ml for anti-FHA, \< 2.187 IU/ml for anti-PRN, \< 2.693 IU/ml for anti-PT), antibody concentration ≥ 4\*cut\_off IU/ml at Month 1 post-vaccination;
* For initially seropositive subjects (antibody concentrations: ≥ 2.046 IU/ml for anti-FHA, ≥ 2.187 IU/ml for anti-PRN, ≥ 2.693 IU/ml for anti-PT) with pre-vaccination antibody concentration \< 4\*cut\_off IU/ml : antibody concentration at Month 1 ≥ 4 fold the pre-vaccination antibody concentration;
* For initially seropositive subjects (antibody concentrations: ≥ 2.046 IU/ml for anti-FHA, ≥ 2.187 IU/ml for anti-PRN, ≥ 2.693 IU/ml for anti-PT) with pre-vaccination antibody concentration ≥ 4\*cut\_off IU/ml : antibody concentration at Month 1 ≥ 2 fold the pre-vaccination antibody concentration.
